import React, { createContext, useEffect, useState } from "react";

const App = ()=>{
  const [num, setNum] = useState(1);


  const change = ()=>{
    setNum(num+1);
    useEffect(() => {
      alert("how are you");
    })
  }
  return (
    <>
      <button onClick={change}>Click Here {num} </button>
    </>
  )
}

export default App;
